script: |
  super -f text -I q6142.spq | sort > q6142.out

inputs:
  - name: q6142.spq
    data: |
      SELECT DISTINCT - - ( + - ( + col1 ) ) * + CAST ( NULL AS INTEGER ) * - ( - 80 ) AS col0 FROM tab0 (FORMAT parquet) WHERE NOT + col0 * + + col2 BETWEEN - col0 AND NULL AND ( NULL ) BETWEEN + + 36 + - col2 AND + col1 * - 19 / + col2;
  - name: tab0

outputs:
  - name: q6142.out
    data: |
